const CustomInput = ({ name, text }) => {
  return <div>
    <div>{name}</div>
    <input
      type="text"
      value={text}
    />
  </div>
}

export const Config = () => {
  return <div>
    {Object.entries(window.config).map((key, value) => {
      return <CustomInput
        key={key}
        name={key}
        text={value}
      />
    })}
  </div>
}
